<h2>Dirty Business</h2>
<img src="../images/yellow-underline-left.svg" class="heading-underline">
<p>For vacationers, cruising is a chance to make memories that will last a lifetime. However, the environmental consequences that cruise ships create could last even longer.</p>
<p class="instructions">Hover over the yellow circles to explore the environmental impacts.</p>

// make sure this is the svg file you want to retrieve

  // tooltip logic
  $('#air').hover(

      $('#airtext').show();
    },
    function mouseleave() {
      $('#airtext').hide();
    }
  );

  $('#paint').hover(
    function mouseover() {
      $('#painttext').show();
    },
    function mouseleave() {
      $('#painttext').hide();
    }
  );

  $('#coral').hover(
    function mouseover() {
      $('#coraltext').show();
    },
    function mouseleave() {
      $('#coraltext').hide();
    }
  );

  $('#sewage').hover(
    function mouseover() {
      $('#sewagetext').show();
    },
    function mouseleave() {
      $('#sewagetext').hide();
    }
  );

  $('#grey').hover(
    function mouseover() {
      $('#greytext').show();
    },
    function mouseleave() {
      $('#greytext').hide();
    }
  );

  $('#noise').hover(
    function mouseover() {
      $('#noisetext').show();
    },
    function mouseleave() {
      $('#noisetext').hide();
    }
  );

  $('#flag').hover(
    function mouseover() {
      $('#flagtext').show();
    },
    function mouseleave() {
      $('#flagtext').hide();
    }
  );


});

</script>
